import { SmartComponent } from "../../model";
import { AssociatedSmartComponent } from "../../model/model/AssociatedSmartComponent";
import { fetchRequest, apiRoutes, RouteMethod , RequestResponseState} from "./api";

export const getAssociatedSmartComponents = () : Promise<AssociatedSmartComponent[]> => fetchRequest(apiRoutes.getAssociatedSmartComponentPath(RouteMethod.get))  

export const createAssociatedSmartComponents= (assSc: AssociatedSmartComponent) : Promise<RequestResponseState> => fetchRequest(apiRoutes.getAssociatedSmartComponentPath(RouteMethod.post),false, assSc)
